/** 获取唯一随机 id */
export function getUUID() {
  const s = [];
  const hexDigits = '0123456789abcdef';

  for (let i = 0; i < 36; i++) {
    s[i] = hexDigits.substr(Math.floor(Math.random() * 0x10), 1);
  }
  s[14] = '4';
  s[19] = hexDigits.substr((s[19] & 0x3) | 0x8, 1);
  s[8] = s[13] = s[18] = s[23] = '-';

  const uuid = s.join('');

  return uuid;
}

export function getUUUID() {
  const s = [];
  const hexDigits = '0123456789abcdef';

  for (let i = 0; i < 36; i++) {
    s[i] = hexDigits.substr(Math.floor(Math.random() * 0x10), 1);
  }
  s[14] = '4';
  s[19] = hexDigits.substr((s[19] & 0x3) | 0x8, 1);

  const uuuid = s.join('');

  return uuuid;
}

/**
 * 千位分割
 * @param num
 * @returns {*|string}
 */
export function thousandBitSeparator(num) {
  return (
    num &&
    (num.toString().indexOf('.') !== -1
      ? num.toString().replace(/(\d)(?=(\d{3})+\.)/g, ($0, $1) => {
          return `${$1},`;
        })
      : num.toString().replace(/(\d)(?=(\d{3}))/g, ($0, $1) => {
          return `${$1},`;
        }))
  );
}

