// 格式化json， json:json字符串  options：原生js，不用穿
export function formatJson(json, options) {
  let reg = '';
  let formatted = '';
  let pad = 0;
  let PADDING = '';
  options = options || {};
  options.newlineAfterColonIfBeforeBraceOrBracket =
    options.newlineAfterColonIfBeforeBraceOrBracket === true ? true : false;
  options.spaceAfterColon = options.spaceAfterColon === false ? false : true;
  if (typeof json !== 'string') {
    json = JSON.stringify(json);
  } else {
    json = JSON.parse(json);
    json = JSON.stringify(json);
  }
  reg = /([\{\}])/g;
  json = json.replace(reg, '\r\n$1\r\n');
  reg = /([\[\]])/g;
  json = json.replace(reg, '\r\n$1\r\n');
  reg = /(\,)/g;
  json = json.replace(reg, '$1\r\n');
  reg = /(\r\n\r\n)/g;
  json = json.replace(reg, '\r\n');
  reg = /\r\n\,/g;
  json = json.replace(reg, ',');
  if (!options.newlineAfterColonIfBeforeBraceOrBracket) {
    reg = /\:\r\n\{/g;
    json = json.replace(reg, ':{');
    reg = /\:\r\n\[/g;
    json = json.replace(reg, ':[');
  }
  if (options.spaceAfterColon) {
    reg = /\:/g;
    json = json.replace(reg, ':');
  }
  json.split('\r\n').forEach(function(node, index) {
    let i = 0;
    let indent = 0;
    let padding = '';
    if (node.match(/\{$/) || node.match(/\[$/)) {
      indent = 1;
    } else if (node.match(/\}/) || node.match(/\]/)) {
      if (pad !== 0) {
        pad -= 1;
      }
    } else {
      indent = 0;
    }
    for (i = 0; i < pad; i++) {
      padding += PADDING;
    }
    formatted += padding + node + '\r\n';
    pad += indent;
  });
  return formatted;
}

export function formatXML(text) {
  // 去掉多余的空格
  text =
    '\n' +
    text
      .replace(/(<\w+)(\s.*?>)/g, function($0, name, props) {
        return name + ' ' + props.replace(/\s+(\w+=)/g, ' $1');
      })
      .replace(/>\s*?</g, '>\n<');
  // 把注释编码
  text = text
    .replace(/\n/g, '\r')
    .replace(/<!--(.+?)-->/g, function($0, text) {
      var ret = '<!--' + escape(text) + '-->';
      return ret;
    })
    .replace(/\r/g, '\n');
  // 调整格式
  const rgx = /\n(<(([^\?]).+?)(?:\s|\s*?>|\s*?(\/)>)(?:.*?(?:(?:(\/)>)|(?:<(\/)\2>)))?)/gm;
  const nodeStack = [];
  const output = text.replace(rgx, function(
    $0,
    all,
    name,
    isBegin,
    isCloseFull1,
    isCloseFull2,
    isFull1,
    isFull2
  ) {
    const isClosed = isCloseFull1 == '/' || isCloseFull2 == '/' || isFull1 == '/' || isFull2 == '/';
    let prefix = '';
    if (isBegin == '!') {
      prefix = getPrefix(nodeStack.length);
    } else {
      if (isBegin != '/') {
        prefix = getPrefix(nodeStack.length);
        if (!isClosed) {
          nodeStack.push(name);
        }
      } else {
        nodeStack.pop();
        prefix = getPrefix(nodeStack.length);
      }
    }
    const ret = '\n' + prefix + all;
    return ret;
  });

  const prefixSpace = -1;
  let outputText = output.substring(1);
  // 把注释还原并解码，调格式
  outputText = outputText
    .replace(/\n/g, '\r')
    .replace(/(\s*)<!--(.+?)-->/g, function($0, prefix, text) {
      if (prefix.charAt(0) == '\r') prefix = prefix.substring(1);
      text = unescape(text).replace(/\r/g, '\n');
      const ret = '\n' + prefix + '<!--' + text.replace(/^\s*/gm, prefix) + '-->';
      return ret;
    });
  return outputText.replace(/\s+$/g, '').replace(/\r/g, '\r\n');
}

export function getPrefix(prefixIndex) {
  const span = '';
  const output = [];
  for (let i = 0; i < prefixIndex; ++i) {
    output.push(span);
  }
  return output.join('');
}

